description:
Verenigde Staten
Thriller / Misdaad
90 minuten

goed

met Harvey Keitel, Cuba Gooding Jr. en Miguel Ferrer

Joshua (Cuba Gooding Jr.), die geld int voor een meedogenloze maffiabaas (Miguel Ferrer), leeft in een wereld vol met bruut 
geweld en mooie vrouwen. Maar wanneer hij zich in het midden van een machtsstrijd bevindt met de meest dominante drugsbaron in 
het milieu (Harvey Keitel), beseft hij dat elke stap de verkeerde kan zijn.
